import request from "@/util/requestUtil";
import { ElMessage, ElMessageBox } from "element-plus";
import { Unlock } from "@element-plus/icons-vue";
export default {
  name: 'UseSet',
  components: {
    Unlock
  },
  data() {
    return {
      tree: [],
      //组织架构数据
      dialogTitle: '添加用户',
      rid: null,
      //添加用户时用户的角色
      username: null,
      state: null,
      UserVisible: false,
      organization: [],
      //所有节点
      roles: [],
      //用户所具有角色
      user: {
        id: null,
        phone: null,
        address: null,
        username: null,
        password: null,
        embod: null,
        email: null,
        state: null,
        organizationId: null,
        role: null
      },
      userData: [],
      //用户表格数据
      options: [{
        value: true,
        label: '正常'
      }, {
        value: false,
        label: '锁定'
      }],
      defaultProps: {
        label: 'name',
        children: 'children'
      }
    };
  },
  methods: {
    //初始化user对象
    initUser() {
      this.user = {
        id: null,
        phone: null,
        address: null,
        username: null,
        password: null,
        embod: null,
        email: null,
        state: null,
        organizationId: null,
        role: null
      };
    },
    // 初始化所有用户信息
    initAllUser(user) {
      request.initAllUser(user).then(resp => {
        if (resp.data) {
          this.userData = resp.data;
          console.log(resp.data);
          this.initUser();
        }
      });
    },
    // 按要求搜索用户
    search() {
      this.user.username = this.username;
      this.user.state = this.state;
      this.initAllUser(this.user);
      this.user.state = null;
    },
    // 是否禁用用户
    disableUser(data) {
      let u = JSON.parse(sessionStorage.getItem("user"));
      if (u.id === data.id) {
        ElMessage.error("自己不能禁止自己");
        return;
      }
      this.user.id = data.id;
      request.updateUser(data).then(resp => {
        if (resp.data.code === 200) {
          // 将user对象，各项值改为null
          this.initUser();
          ElMessage.success(resp.data.message);
          this.initAllUser(this.user);
        } else {
          ElMessage.error(resp.data.message);
        }
      });
    },
    // 删除用户
    deleteUser(data) {
      let u = JSON.parse(sessionStorage.getItem("user"));
      if (u.id === data.id) {
        ElMessage.error("目前登录用户无法删除");
        return;
      }
      request.deleteUser(JSON.stringify(data.id)).then(resp => {
        if (resp.data.code === 200) {
          this.initAllUser(this.user);
          ElMessage.success(resp.data.message);
        } else {
          ElMessage.error(resp.data.message);
        }
      });
    },
    // 取消添加用户
    cancelUser() {
      this.UserVisible = false;
      this.initUser();
      this.dialogTitle = '添加用户';
    },
    addUpdateUser() {
      if (this.dialogTitle === '添加用户') {
        if (this.user.username === null || this.user.password === null) {
          ElMessage.error("请输入用户名或密码");
          return;
        }
        request.addUser(this.user).then(resp => {
          if (resp.data.code === 200) {
            this.initUser();
            this.initAllUser(this.user);
            this.UserVisible = false;
            ElMessage.success(resp.data.message);
          } else {
            ElMessage.error(resp.data.message);
            this.initUser();
            this.UserVisible = false;
            ElMessage.success(resp.data.message);
          }
        });
      } else {
        this.user.state = null;
        request.updateUser(this.user).then(resp => {
          if (resp.data.code === 200) {
            // 如果修改的是当前登录用户，则重新获取当前用户信息，并存入sessionStorage
            if (this.user.id === JSON.parse(sessionStorage.getItem("user")).id) {
              request.getUserById(this.user.id).then(resp => {
                if (resp.data.code === 200) {
                  sessionStorage.setItem("user", JSON.stringify(resp.data.user));
                }
              });
            }
            if (this.rid != null) {
              request.updateUserRole(this.rid, this.user.id).then(resp => {
                if (resp.data.code === 200) {
                  this.initUser();
                  this.initAllUser(this.user);
                } else {
                  ElMessage.error(resp.data.message);
                }
              });
            }
            ElMessage.success(resp.data.message);
          } else {
            ElMessage.error(resp.data.message);
          }
          this.initUser();
          this.initAllUser(this.user);
          this.dialogTitle = '添加用户';
          this.rid = null;
          this.UserVisible = false;
        });
      }
    },
    // 修改用户
    updateUser(data) {
      this.UserVisible = true;
      this.dialogTitle = '修改用户';
      this.user.id = data.id;
      this.user.username = data.username;
      this.user.phone = data.phone;
      this.user.email = data.email;
      this.user.address = data.address;
      this.user.embod = data.embod;
      this.user.state = data.state;
    }
  },
  watch: {
    username(newValue, oldValue) {
      if (newValue === '') {
        this.initAllUser(this.user);
      }
    },
    state(newValue, oldValue) {
      if (newValue === '') {
        this.initAllUser(this.user);
      }
    }
  },
  mounted() {
    this.initAllUser(this.user);
  }
};
